import styled from 'styled-components';

export const Logo = styled.div`
  position: fixed;
  margin-left: 5vw;
  margin-top: 5vh;

  :hover {
    cursor: pointer;
  }
`;

export const NoResults = styled.div`
  color: white;
  font-size: 40px;
  padding-top: 20%;
  min-height: 100vh;
`;

export const PageWrapper = styled.div`
  min-height: 100vh;
`;
